/************************************************************************
*
*   FUNCTION
*
*       Commit_$table_row_name$_Status
*
*   DESCRIPTION
*
*       This function handles SNMP COMMIT operations on row_status of
*       $table_row_name$.
*
*************************************************************************/
UINT16 Commit_$table_row_name$_Status(
                  $TABLE_ROW_NAME$_STRUCT *$table_row_name$, UINT8 row_status,
                  UINT8 is_new, INT32 *table_row_status)
{
    /* Status for returning success or error code. */
    UINT16          status = SNMP_NOERROR;

    if((row_status != 0) &&
       (row_status != SNMP_ROW_CREATEANDGO) &&
       (row_status != SNMP_ROW_CREATEANDWAIT))
    {
        switch(row_status)
        {
        case SNMP_ROW_ACTIVE:

            /* New entries and not ready entries can't be activated.
               However, new entry can be activated by setting it's
               status to CREATEANDGO. */
            if(!is_new)
            {
                /* Activating the entry. */
                *table_row_status = SNMP_ROW_ACTIVE;
            }

            else
            {
                /* Setting status to error code of in-consistent 
                   value. */
                status = SNMP_INCONSISTANTVALUE;
            }

            break;

        case SNMP_ROW_NOTINSERVICE:

            /* Row status can't be set to NOTINSERVICE for new and
               not ready entries. However row status can be set to
               NOTINSERVICE by setting row status to CREATEANDWAIT for
               new entries. */
            if(!is_new)
            {
                /* Setting the row status to 'NOTINSERVICE'. */
                *table_row_status = SNMP_ROW_NOTINSERVICE;
            }

            else
            {
                /* Inconsistent value. */
                status = SNMP_INCONSISTANTVALUE;
            }

            break;

        case SNMP_ROW_DESTROY:

            /* Setting row status to SNMP_ROW_DESTROY. */
            *table_row_status = SNMP_ROW_DESTROY;

            break;

        default:
            if (($table_row_name$->row_flag == 0) ||
                ($table_row_name$->row_flag == SNMP_ROW_DESTROY))
            {
                status = SNMP_INCONSISTANTVALUE;
            }
            else if ($table_row_name$->row_flag == SNMP_ROW_CREATEANDGO)
            {
                *table_row_status = SNMP_ROW_ACTIVE;
            }
            else if ($table_row_name$->row_flag == SNMP_ROW_CREATEANDWAIT)
            {
                *table_row_status = SNMP_ROW_NOTINSERVICE;
            }

        }
    }

    else
    {
        switch(row_status)
        {
        case SNMP_ROW_CREATEANDGO:

            /* Entry should be ready and either new or non-active. */
            if((is_new) || 
               (*table_row_status != SNMP_ROW_ACTIVE))
            {
                /* Activating the entry. */
                *table_row_status = SNMP_ROW_ACTIVE;
            }

            else
            {
                /* Setting status to error code of in-consistent 
                   value. */
                status = SNMP_INCONSISTANTVALUE;
            }

            break;

        case SNMP_ROW_CREATEANDWAIT:

            /* Entry should not be 'active'. */
            if(*table_row_status != SNMP_ROW_ACTIVE)
            {
                *table_row_status = SNMP_ROW_NOTINSERVICE;
            }

            else
            {
                /* Setting status to error code of in-consistent 
                   value. */
                status = SNMP_INCONSISTANTVALUE;
            }

            break;

        default:

            if (($table_row_name$->row_flag == 0) ||
                ($table_row_name$->row_flag == SNMP_ROW_DESTROY))
            {
                *table_row_status = SNMP_ROW_NOTINSERVICE;
            }
            else if ($table_row_name$->row_flag == SNMP_ROW_CREATEANDGO)
            {
                *table_row_status = SNMP_ROW_ACTIVE;
            }
            else if ($table_row_name$->row_flag == SNMP_ROW_CREATEANDWAIT)
            {
                *table_row_status = SNMP_ROW_NOTINSERVICE;
            }

        }
    }

    /* Return success or error code. */
    return (status);

} /* Commit_$table_row_name$_Status */

/************************************************************************
*
*   FUNCTION
*
*       Commit_$table_row_name$_Entries
*
*   DESCRIPTION
*
*       This shift all the temporary entries to pemanent of
*       $table_row_name$.
*
*************************************************************************/
VOID Commit_$table_row_name$_Entries(VOID)
{
    /* Handle to the view tree family entry. */
    $TABLE_ROW_NAME$_STRUCT    *$table_row_name$;

    /* Start traversing temporary list. */
    $table_row_name$ = $module_name$_mosy.temp_$table_name$_tbl.flink;

    /* Loop to traverse temporary list. */
    while ($table_row_name$)
    {
        /* Add entry to the permanent list. */
        if (NU_Add_$table_row_name$($table_row_name$) != NU_SUCCESS)
        {
            NLOG_Error_Log("Copy to permanent table failed",
                            NERR_SEVERE, __FILE__, __LINE__);
        }

        /* Remove entry from the temporary list. */
        if (Remove_$table_row_name$_Util($table_row_name$, 
                          &($module_name$_mosy.temp_$table_name$_tbl)) != NU_SUCCESS)
        {
            NLOG_Error_Log("Remove from temporary table failed",
                            NERR_SEVERE, __FILE__, __LINE__);       
        }

        /* Moving forward in the temporary list. */
        $table_row_name$ = $module_name$_mosy.temp_$table_name$_tbl.flink;
    }

    /* Start traversing permanent list. */
    $table_row_name$ = $module_name$_mosy.$table_name$_tbl.flink;

    /* Loop to clear row flag. */
    while ($table_row_name$)
    {
        /* Clear out row flag. */
        $table_row_name$->row_flag = 0;

        /* Moving forward in the list. */
        $table_row_name$ = $table_row_name$->flink;
    }

} /* Commit_$table_row_name$_Entries */

/************************************************************************
*
*   FUNCTION
*
*       Commit_$table_row_name$
*
*   DESCRIPTION
*
*       This funtion handles COMMIT operation on $table_row_name$.
*
*************************************************************************/
UINT16 Commit_$table_row_name$ (snmp_object_t *obj)
{
    $TABLE_ROW_NAME$_STRUCT    *$table_row_name$ = NU_NULL;

    $TABLE_ROW_NAME$_STRUCT    *temp_$table_row_name$ = NU_NULL;

    /* Row status leaf of the table row. */
    INT32   row_status;

    /* Transitions from one row status value to another. */
    UINT16                  status_trans[6][4] =
    {
     {SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE, SNMP_NOERROR,
      SNMP_NOERROR},
     {SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE, SNMP_NOERROR,
      SNMP_NOERROR},
     {SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE,
      SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE},
     {SNMP_NOERROR, SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE,
      SNMP_INCONSISTANTVALUE},
     {SNMP_NOERROR, SNMP_INCONSISTANTVALUE, SNMP_INCONSISTANTVALUE,
      SNMP_INCONSISTANTVALUE},
     {SNMP_NOERROR, SNMP_NOERROR, SNMP_NOERROR, SNMP_NOERROR}
    };

    /* Current position initialized to first index. */
    UINT32    curr_pos = $table_row_OID_len + 1$;

    $Tab_Length++$
    $Index_Declarations$ 
    $Tab_Length--$

    UINT16 status = SNMP_NOERROR;

    UINT32 row_status_leaf_index;

    UINT32 current_state;

    $Tab_Length++$
    $Get_Indexes_Without_GetFlag$ 
    $Tab_Length--$

    if (curr_pos != obj->IdLen)
    {
        /* Return error code. */
        status = SNMP_NOSUCHINSTANCE;
    }

    if (status == SNMP_NOERROR) 
    {
        /* Get the handle from the temporary list. */
        $table_row_name$ = $table_row_name$_Get_Util($&list_of_indexes$, 
                                   &($module_name$_mosy.temp_$table_name$_tbl));

        temp_$table_row_name$ = $table_row_name$;

        if($table_row_name$ == NU_NULL)
        {
            /* Get the handle from the permanent list. */
            $table_row_name$ = $table_row_name$_Get_Util($&list_of_indexes$, 
                                              &($module_name$_mosy.$table_name$_tbl));
        }
    }

    if($table_row_name$ != NU_NULL)
    {
        $Tab_Length++$
        $Tab_Length++$

        $Get_Row_Status_Leaf_Index$

        $Get_Row_Status$

        $Tab_Length--$
        $Tab_Length--$

        if(obj->Id[$table_row_OID_len$] == row_status_leaf_index)
        {
             /* Set the value of current state.
             *  0) New entry.
             *  1) Not ready.
             *  2) Not in service.
             *  3) Active.
             */

            /* If the handle is from temporary list then set value of
             * current state to 0.
             */
            if (temp_$table_row_name$)
            {
                current_state = 0;
            }

            /* If entry is from permanent list and row status is not
             * in service then set the value of current state to 1.
             */
            else
            {
                /* If entry is from permanent list and row status is not
                 * active then set the value of current state to 2.
                 */
                if (row_status != SNMP_ROW_ACTIVE)
                {
                    current_state = 2;
                }

                /* If the entry is from permanent list and is active then
                 * set the current state to 3.
                 */
                else
                {
                    current_state = 3;
                }
            }

            /* If required state transition is not allowed then return
             * error code.
             */
            if (status_trans[obj->Syntax.LngUns - 1][current_state] !=
                                                         SNMP_NOERROR)
            {
                /* Return error code. */
                status =
                  status_trans[obj->Syntax.LngUns - 1][current_state];
            }

            /* If the request is valid then commit the row status
             * value.
             */
            else
            {
                status = Commit_$table_row_name$_Status(
                        $table_row_name$, (UINT8)(obj->Syntax.LngUns),
                        (UINT8)(temp_$table_row_name$ != NU_NULL), &row_status );
            }
        }

        /* If it was not row set operation. */
        else
        {
            /* Commit row status. */
            status = Commit_$table_row_name$_Status($table_row_name$, 0, NU_FALSE, 
                                                     &row_status);
        }

        /* If the row status is set to 'DESTROY'. */
        if (row_status == SNMP_ROW_DESTROY)
        {
            /* If handle was from temporary list then remove it from
             * temporary list.
             */
            if (temp_$table_row_name$)
            {
                status = (UINT16)Remove_$table_row_name$_Util($table_row_name$, 
                                  &($module_name$_mosy.temp_$table_name$_tbl));                    
            }

            /* If handle was from permanent list then remove it from
             * permanent list.
             */
            else
            {
                status = (UINT16)NU_Remove_$table_row_name$($table_row_name$);
            }

        }
    }

    /* If commit operation went okay, and this was the last commit
     * operation then shift all the entries from temporary list to
     * permanent list.
     */
    if ( (status == SNMP_NOERROR) && ($table_row_name$_Commit_Left == 0) )
    {
        Commit_$table_row_name$_Entries();
    } 

    /* Return success or error code. */
    return (status);

}/* Commit_$table_row_name$ */

/************************************************************************
