    {
        /* Return error in case of SNMP SET request on read-only varibale $leaf_name$. */
        status = SNMP_NOSUCHNAME;
    }
    else
    {
        /* If we don't have valid OID then return error code. */
        if (MibSimple(obj, IdLen) == NU_FALSE)
        {
            /* Return error code in case of invalid request. */
            status = SNMP_NOSUCHNAME;
        }
        else
        {
            /* Set syntax length to maximum the length it can hold. */
            obj->SyntaxLen = sizeof(obj->Syntax);

            /* Call the approtiate function for Retrieving the value of $leaf_name$. */
            status  = (UINT16) Get_$leaf_name$(&(obj->Syntax), &(obj->SyntaxLen));
        }
    }

