/*************************************************************************
*   FUNCTION
*
*        $table_row_name$
*
*   DESCRIPTION
*
*        This function is used to handle requests of $table_name$.
*
*************************************************************************/
UINT16 $table_row_name$(snmp_object_t *obj, UINT16 idlen, VOID *param)
{
    /* Status to return success or error code. */
    UINT16          status;

    /* Flag to distinguish between GET and GET-NEXT requests. */
    UINT8           getflag = 0;

    /* Avoid compilation warnings. */
    UNUSED_PARAMETER(param);
    UNUSED_PARAMETER(idlen);

    switch(obj->Request)
    {
    case SNMP_PDU_GET:                      /* GET request. */
        /* Set getflag to represent GET request. */
        getflag++;			    /* getflag = 1 */

        /* Fall through the next case for fulfilling the get-request. */

    case SNMP_PDU_NEXT:                     /* GET-NEXT request. */

        /* Processing get operations. */	        
        status = Get_$table_row_name$(obj, getflag);    /* getflag = 0 */

        break;

#if ( (INCLUDE_SNMPv2 == NU_TRUE) || (INCLUDE_SNMPv3 == NU_TRUE) )
    case SNMP_PDU_BULK:                     /* GET-BULK request. */

        /* Processing of bulk operation. */
        status = SNMP_Get_Bulk(obj, Get_$table_row_name$);
        break;

#endif /*( (INCLUDE_SNMPv2 == NU_TRUE) || (INCLUDE_SNMPv3 == NU_TRUE) ) */

    case SNMP_PDU_SET:                      /* SET request. */
    case SNMP_PDU_UNDO:                     /* UNDO request. */
        status = Set_$table_row_name$(obj);
        break;

    case SNMP_PDU_COMMIT:                   /* COMMIT request. */
        /* We always have the successful SET operation. */
        status = SNMP_NOERROR;
        break;

    default:                                /* Invalid request. */
        status = SNMP_GENERROR;
    }

    /* Return success or error code. */
    return (status);

} /* $table_row_name$ */

