/*************************************************************************
*
*   FUNCTION
*
*       $leaf_name$
*
*   DESCRIPTION
*
*       This function processes the PDU action on the $leaf_name$.
*
*************************************************************************/
UINT16 $leaf_name$(snmp_object_t *obj, UINT16 IdLen, VOID *param)
{
    /* Status to return success or error code. */
    UINT16  status = SNMP_NOERROR;

    /* Avoid compilation warnings. */
    UNUSED_PARAMETER(param);

    /* If we don't have valid OID then return error code. */
    if (MibSimple(obj, IdLen) == NU_FALSE)
    {
        /* Return error code in case of invalid request. */
        status = SNMP_NOSUCHNAME;
    }

    /* If this is a valid read request (GET, GET-NEXT, GET-BULK). */
    else if ( (obj->Request != SNMP_PDU_SET) &&
              (obj->Request != SNMP_PDU_UNDO) &&
              (obj->Request != SNMP_PDU_COMMIT) )
    {
        /* Set the length to the maximum it can hold. */
        obj->SyntaxLen = sizeof(obj->Syntax);

        /* Call appropriate function to get the value of $leaf_name$. */
        status = (UINT16) Get_$leaf_name$(&(obj->Syntax), &(obj->SyntaxLen));
    }

    /* We don't have do anything for COMMIT. */
    else if (obj->Request != SNMP_PDU_COMMIT)
    {
        /* Call appropriate function to set the value of $leaf_name$. */
        status = (UINT16) Set_$leaf_name$(&(obj->Syntax), obj->SyntaxLen);
    }

    /* Return success or error code. */
    return (status);

} /* $leaf_name$ */

